import React, { FC } from 'react'
import style from './Button.css'

const Button = style()

export interface IButtton {
    onClick?: Function,
    label?: string,
    background?: any,
    color?: string,
}

const FormButton:FC<IButtton> = ({onClick, label, background, color}) => {
  return <Button className={background}>{label}</Button>
}

export default FormButton
